import React from 'react';
import './NavBar.css';

const button = (props) => (
    <button className='.NavBar-onebutton' onClick={props.clicked}>
        {props.children}
    </button>
);

export default class NavButton extends React.Component {

    render() {
        return(
            <div className='NavBar'>
                <p>This is my nav bar! lol not yet but we're getting there</p>
                <div className='NavBar-buttons'>
                    <button className='NavBar-onebutton'>Link 1</button>
                    <button className='NavBar-onebutton'>Link 2</button>
                    <button className='NavBar-onebutton'>Link 3</button>
                </div>
            </div>
        );
    }
}
